export default function submitForm(formData) {
    debugger;
    return (dispatch) => {
       switch(formData.infoType) {
           case 'Starting Zip Code':
               dispatch({ type: 'ADD_STARTING_ZIP_CODE', data: formData.data })
            case 'Destination Zip Code':
                dispatch({ type: 'ADD_DESTINATION_ZIP_CODE', data: formData.data })
            case 'Number of Bedrooms':
                dispatch({ type: 'ADD_NUMBER_OF_BEDROOMS', data: formData.data })
            default:
                dispatch({ type: 'ERROR' });
       }
    }
}
